import React from 'react'
import resimg from './images/icons8-restaurant-48.png'
import { Link } from 'react-router-dom';
import { useSelector } from 'react-redux';
import profImg from '../../images/icons8-user-100.png'
import axios from 'axios';

function AddresHome() {
    const userData = useSelector((state) => state.users?.users?.userDetails ?? 'Not available');


    const deleteAccount = async ()=>{
        try {
            const res = await axios.delete("http://localhost:5000/", input, {
                withCredentials: true
            });
            navigateNext(res.data);
           
        }
        catch {
            alert("Error during login:', error")
        }
    }



    return (
        <div className='resDash'>
            <Link className='Link' to={"/Addrestaurant"}>
                <div className='dashboard'  >
                    <h2>Add Restuarants</h2>
                    <img className='resIcons' src={resimg} alt="" />
                </div>
            </Link>

            <div className='dashboard'>
                <h2>Edit Restaurants</h2>
                <img className='resIcons' src={resimg} alt="" />
            </div>
            <div className='dashboard'>
                <h2>Remove Restuarants</h2>
                <img className='resIcons' src={resimg} alt="" />
            </div>
            <Link className='Link' to={`/userProfile/${userData.userId}`}>
                <div className='dashboard'>
                    <h2>Edit Profile</h2>
                    <img className='resIcons' src={resimg} alt="" />
                </div>
            </Link>
            <div className='dashboard'>
                <h2>Delete account</h2>
                <img className='resIcons' src={profImg} alt="" />
            </div>

        </div>
    )
}

export default AddresHome
